import React, {useState, useEffect} from 'react';
import FetchStockData from "../components/FetchStockData";
import FetchStockList from "../components/FetchStockList";
import ChartOfClose from "../components/ChartOfClose";
import '../styles/Navbar.css';
import './Home.css';
import AdBanner from '../assets/ad-banner.jpg';


function Home() {
    const [stockData, setStockData] = useState([]);
    const [stockList, setStockList] = useState([]);
    const [filteredData, setFilteredData] = useState([]);
    const [selectedStock, setSelectedStock] = useState(null);
    const [selectedStockName, setSelectedStockName] = useState('');

    useEffect(() => {
        document.body.classList.add('home');

        return () => {
            document.body.classList.remove('home');
        };
    }, []);

    useEffect(() => {

        if(stockList.length > 0 && stockData.length > 0) {
            const latestDataMap = new Map()

            stockData.forEach((data) => {
                const existingData = latestDataMap.get(data.stock_code);
                if (!existingData || new Date(existingData.date) < new Date(data.date)) {
                    const matchingStock = stockList.find(stock => stock.code === data.stock_code);
                    if (matchingStock) {
                        latestDataMap.set(data.stock_code, {
                            ...data,
                            stock_name: matchingStock.name // 이름을 함께 저장
                        });
                    }
                }
            });

            const filtered = stockList
                .filter(stock => latestDataMap.has(stock.code))
                .map(stock => latestDataMap.get(stock.code))
                .sort((a, b) => b.volume - a.volume); // 거래량(volume) 기준으로 내림차순 정렬

            setFilteredData(filtered);
        }
    }, [stockList, stockData]);

     const handleStockClick = (stockCode) => {
        setSelectedStock(stockCode);
        setSelectedStockName(stockName);

    };

    return (
        <>
            <div className='navbar'><h2>ProStock</h2></div>

            {/* 광고 영역 추가 */}
            <div className='ad-container'>
                <img src={AdBanner} alt="Ad Banner" className='ad-banner'/>
                <p><strong>광 고 내 놔</strong></p>
            </div>

            <div className='home-container'>
                <FetchStockList onListFetch={setStockList}/>
                <FetchStockData onDataFetch={setStockData}/>

                <div className='table-container'>
                    <table className="table">
                        <thead>
                        <tr>
                            <th>종목명</th>
                            <th>일자</th>
                            <th>종가</th>
                            <th>고가</th>
                            <th>저가</th>
                            <th>시가</th>
                            <th>거래량</th>
                        </tr>
                        </thead>
                        <tbody>
                        {filteredData.map((data, index) => (
                            <tr key={index}>
                                <td className="stock_name"
                                    onClick={() => handleStockClick(data.stock_code)} style={{
                                    cursor: 'pointer',
                                    color: 'blue',
                                }}>
                                    {data.stock_name}
                                </td>
                                <td>{data.date}</td>
                                <td>{data.close}</td>
                                <td>{data.high}</td>
                                <td>{data.low}</td>
                                <td>{data.open}</td>
                                <td>{data.volume}</td>
                            </tr>
                        ))}
                        </tbody>
                    </table>
                </div>
                <div className="chart-container">
                    {selectedStock && <ChartOfClose stockCode={selectedStock} />}
                </div>
            </div>
            </>
        );
    }

export default Home;
